package org.teste.memcached.tests;

import org.teste.memcached.utils.MemcachedPoolUtils;

import com.whalin.MemCached.MemCachedClient;

public class TesteTextoGrande {

	public static void main( String[] args ) {
		try{

			MemCachedClient mcc = MemcachedPoolUtils.initializePool(true);

			mcc.flushAll();

			String key = "#COSystemSettingsLogic!loadUnique";
			String value = createBigText();

			boolean ret = mcc.set(key, value);

			System.out.println("Retorno: "+ret);
			System.out.println("GET: "+mcc.get(key));

		} catch (Exception e) {
			e.printStackTrace();
		}

	}

	private static String createBigText() {
		return "";
	}
}
